import { useState } from "react"; 


function SearchProduct() {

    const [productDetails] = useState[null];

    return <>
        <div id='productId'>
            <div id='serach'>  
                <p> Search Product : &nbsp;
                    <input type='text' /> &nbsp;
                    <button id='btn' onClick={alert('serach')}> Search Product</button>
                </p>
            </div>
            <div id='body'>
                <p>Search Result</p>
                if(productDetails === null ?<p>Not Found</p>:<p>Result</p>)
            </div>
        </div>
    </>
}

export default SearchProduct;
